	display: inline;
	margin: 25px 30px;
`;
const HomeProfile = styled.h1`
	font-size: 1.5em;
	text-align: start;
	color: palevioletred;
	margin: 0;
	float: left;
`;

const ProfileAvatar = styled.div`
	text-align: end;
	font-size: 1.5em;
`;
